import React from 'react';
import './main.css';

const Main_section = () => {
  return (
    <section id="header_container">
      <div className="image_container">
        <img 
          src="/img/IMG_2458.jpg" 
          alt="placeholder" 
          className="image" 
        />
      </div>
      <div className="text-container">
        <h1>Mountain Beauty with Reliable Gear</h1>
        <p> With our gear, you'll experience the mountains like never before and fall even deeper in love with them. Every peak will feel closer, and every adventure will be safe and unforgettable.
        </p>
      </div>
    </section>

  );
};

export default Main_section;
